export const addVaccination = (newVaccination) => {
  return {
    type: "ADD_VACCINATION",
    payload: newVaccination,
  };
};

export const addPetVaccinationList = (petVaccinationList) => {
  return {
    type: "ADD_VACCINATION_LIST",
    payload: petVaccinationList,
  };
};
